import React from "react";
import ReactDOM from "react-dom";
import "./index.css"; // Optional, for styling if you need it
import { TransactionProvider } from "./contexts/TransactionContext"; // Import the context provider
import App from "./App"; // Import the main App component

// Rendering the App component inside the root div, wrapped with the TransactionProvider
ReactDOM.render(
  <React.StrictMode>
    <TransactionProvider>
      <App />
    </TransactionProvider>
  </React.StrictMode>,
  document.getElementById("root")
);
